import React, { Component } from "react";
import "./ApplyDataBase.less";
import { Collapse, Icon, Input, Empty, Button, Form ,Tooltip} from "antd";
import http from "../../../utils/api";


class ApplyDataBase extends Component {
  state = {
    collapsed: false,
  };
  componentDidMount = async () => {
    let res;
  };
  render() {
    const { getFieldDecorator } = this.props.form;
    const formItemLayout = {
      labelCol: {
        xs: { span: 24 },
        sm: { span: 8 },
      },
      wrapperCol: {
        xs: { span: 24 },
        sm: { span: 16 },
      },
    };
    const tailFormItemLayout = {
      wrapperCol: {
        xs: {
          span: 24,
          offset: 0,
        },
        sm: {
          span: 16,
          offset: 8,
        },
      },
    };
    return (
      <div className="applyDataBase">
      <Form {...formItemLayout} onSubmit={this.handleSubmit} className="applyDataBase-form">
              <h1>参与CHASE-IBD数据库建设申请表</h1>
              <h3>申请医疗单位</h3>
              <Form.Item>
                {getFieldDecorator("user", {
                  rules: [{ required: true, message: "请输入你的手机号!" }]
                })(
                  <Input
                    size="large"
                    prefix={
                      <Icon type="phone" style={{ color: "rgba(0,0,0,.25)" }} />
                    }
                    placeholder="手机号"
                  />
                )}
              </Form.Item>
              <Form.Item
          label={
            <span>
              Nickname&nbsp;
            </span>
          }
        >
          {getFieldDecorator('nickname', {
            rules: [{ required: true, message: 'Please input your nickname!', whitespace: true }],
          })(<Input />)}
        </Form.Item>
              <h3>申请医疗单位</h3>贵院目前患者数量

              <h3>申请人</h3>
              <Button
                type="primary"
                htmlType="submit"
                className="login-form-button"
                onClick={this.login}
                size="large"
              >
                登录
              </Button>
              <div className="login-form-register">
                <a onClick={this.onRegister}>注册</a>
              </div>
            </Form>
      </div>
    );
  }
}

export default Form.create()(ApplyDataBase) ;
